import React from "react";
import Link from "next/link";
import { Link as ScrollLink } from "react-scroll";

const NavLinks = () => {  
  return (
    <ul className="main-nav__navigation-box one-page-scroll-menu">
      <li>
        <ScrollLink
          activeClass="current"
          to="inicio"
          spy={true}
          smooth={true}
          offset={-70}
          duration={500}
        >
          <a>Inicio</a>
        </ScrollLink>
      </li>
      <li>
        <ScrollLink
          activeClass="current"
          to="filosofia"
          spy={true}
          smooth={true}
          offset={-70}
          duration={500}
        >
          Filosofía
        </ScrollLink>
      </li>
      <li>
        <ScrollLink
          activeClass="current"
          to="redes"
          spy={true}
          smooth={true}
          offset={-70}
          duration={500}
        >
          Redes
        </ScrollLink>
      </li>
      <li>
        <ScrollLink
          activeClass="current"
          to="video"
          spy={true}
          smooth={true}
          offset={-70}
          duration={500}
        >
          Así se forman las Redes
        </ScrollLink>
      </li>
      <li>
        <ScrollLink
          activeClass="current"
          to="preguntas-frecuentes"
          spy={true}
          smooth={true}
          offset={-70}
          duration={500}
        >
          Preguntas Frecuentes
        </ScrollLink>
      </li>
    </ul>
  );
};

export default NavLinks;
